import React, { Component} from 'react';

class Resume extends Component{
	render(){
		return(
			<div style = {{width: '100%', margin: 'auto'}}>
					<Grid className = "landing-grid">
						<Cell col={12}>
							<div className = "body">
								<p>I am currently studying Computer Science and Engineering at University of California, Los Angeles.
									As an undergraduate student, I have been expanding my coding experience through personal projects.
									Many of my first personal projects were mobile applications created through Android Studio.
								</p>
							</div>
						</Cell>
					</Grid>
			</div>
		)
	}
}

export default Resume;
